import React from 'react';
import { Button, StyleSheet, Text, View, TouchableOpacity } from 'react-native';


export default class Destination extends React.Component {

    constructor(props) {
        super(props);
        this.buttonPress = this.buttonPress.bind(this);
    }

    buttonPress = () => {
        this.props.navigation.navigate('bookhere');
    }
    render() {

        const buttonStylesubmit = {
            color: "#FFFFFF",
            backgroundColor: "#008484",
            paddingBottom: "10px",
            paddingRight: "18px",
            paddingLeft: "18px",
            fontFamily: "calibri",
            fontSize: "30px",
            marginRight: "80px",
            height: "40px",
            width: "320px",
            marginLeft: 55,
            marginBottom: 20
        }
        return (
            <View style={styles.container}>
                <View style={styles.RectangleShapeView}>
                    <Text style={styles.textHeading}>Destination</Text><br></br>
                </View>
                <View style={styles.RectangleShapeout}>
                    <View>
                        <br></br><button style={buttonStylesubmit} onClick={this.buttonPress}>Infinity Mall, Malad</button>
                        <button disabled={true} style={buttonStylesubmit} onClick={this.buttonPress}>Oberoi Mall,Goregoan</button>
                        <button disabled={true} style={buttonStylesubmit} onClick={this.buttonPress}>Phoenix Mall, Pune</button>
                    </View>            
                </View>
                <View style={styles.RectangleShapedown}></View>
            </View>
        );
    }
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#FFFFFF',
        alignItems: 'center',
        justifyContent: 'center'
    },
    RectangleShapeView: {

        marginTop: 25,
        width: 450,
        height: 70,
        backgroundColor: '#008484',
        marginBottom: 5,
        textAlign: 'center'
    },
    RectangleShapeout: {

        // marginTop: 25,
        width: 450,
        height: 300,
        backgroundColor: '#FFFFFF',
        marginBottom: 2,
        textAlign: 'center',
        border: 6,
        borderColor: '#008484'
    },
    RectangleShapedown: {

        width: 450,
        height: 80,
        backgroundColor: '#008484',
        textAlign: 'center',
    },
    textHeading: {
        color: "#FFFFFF",
        fontSize: "40px",
        fontFamily: "calibri",
        paddingTop: 20,
    },
});
